Recebi, na tarde desta segunda-feira (19), uma moção de louvor da @camaraderesende pelos meus trabalhos em prol do município. Agradeço a iniciativa da Casa por me conceder essa homenagem! 

Tenho um carinho especial por Resende, cidade onde nasci, cresci e a qual dedico também o meu trabalho pelo seu desenvolvimento.

No Orçamento de 2020 a 2023, destinei o valor de R$ 3,5 milhões para a Associação de Proteção à Maternidade e à Infância de Resende (Apmir), R$ 870 mil para a Santa Casa de Misericórdia e uma motoniveladora para atender a área rural da região. 

Contem sempre com o meu trabalho!

