Hoje celebro mais uma importante conquista para a comunidade surda. A assinatura da Ordem de Serviço que ocorreu hoje contemplará a implantação da nova Escola Bilíngue Libras e Português Escrito do Plano Piloto, uma parceria entre os governos federal e distrital. 

Com esta nova unidade, mais de mil estudantes surdos, de todas as regiões administrativas do DF poderão ser beneficiados. 

Parabéns ao Governo do Distrito Federal!

